import styled from 'styled-components';

import dioLogo from '../img/dio1.png';

const Footer = styled.footer`
background-color: #eee;
display: flex;
position: fixed;
bottom: 0;
left: 0;
justify-content: center;
align-items: center;
width: 100%;
height: 70px;
`

const FooterItem = styled.span`
font-size: 18px;
text-decoration: none;
color: #777777;
font-weight: bold;
`



/* ... */

const HeaderImage = styled.div`
  background-image: url(${myImage});
`;


export default function footer() {
  return(
      <React.Fragment>
        <Footer>
            <FooterItem><img src="dio1.png"></img></FooterItem>
        </Footer>
      </React.Fragment>

  );
}
